For that crash you saw the other day… here’s the rest of the story…

We were out shooting some photos and video for @condition1case at @oakhillmx . I ended up falling in a corner and twisting my front end up. I straightened it the best I could but since I didn’t bring any tools, I wasn’t able to get it as straight as I would have liked. I didn’t really think much about it because we’ve all ridden with tweaked bikes before, right? The day was almost done anyways but they wanted me to shoot a few helmet cam shots over this section of the track. There was a pretty good whip rut that was going sideways off the face and that’s what I was thinking most about with a twisted up front end. Turns out, I should have been worried more about the landing. Even though my bars were pointed straight, my wheel wasn’t, which is why my front end knifed both times I did the jump. This was the first time, second one put me on my head. The dirt being freshly worked and soft didn’t help the situation much but it was all my fault… long story, long, bring tools!

